using System;
using System.Text;
using Xunit;

using nebulae.dotBlake2b;

namespace nebulae.dotBlake2bTests;

public class dotBlake2bBoundaryTests
{
    private static byte[] FromHex(string hex) => Convert.FromHexString(hex);
    private static string ToHex(ReadOnlySpan<byte> data)
    {
        var sb = new StringBuilder(data.Length * 2);
        foreach (var b in data)
            sb.AppendFormat("{0:x2}", b);
        return sb.ToString();
    }

    [Fact]
    public void Blake2b_exact_1_block()
    {
        byte[] input = FromHex("4141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141");
        Span<byte> output = stackalloc byte[64];
        var hasher = new Blake2bHasher(64);
        hasher.Update(input);
        hasher.Finalize(output);
        Assert.Equal("f5011c14425def0732ae5ad325ea7ceb558b908e390cb8157d15c365226d4e076789bd1e9534353bfc852bb90c0c1c85755a7cc43f9fafecd8fabade9bcc8d77", ToHex(output));
    }

    [Fact]
    public void Blake2b_just_over_block()
    {
        byte[] input = FromHex("414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141");
        Span<byte> output = stackalloc byte[64];
        var hasher = new Blake2bHasher(64);
        hasher.Update(input);
        hasher.Finalize(output);
        Assert.Equal("3dc8c5e69fe2ad0d8ea8bc16732f00cd7c1ce619783cb91a2f684ccf2e1e95a4aba27640e9f6339df2b1d572c4fb3900deae6330b94e900a934e131b9ca5d136", ToHex(output));
    }

    [Fact]
    public void Blake2b_multi_block()
    {
        byte[] input = FromHex("");
        Span<byte> output = stackalloc byte[64];
        var hasher = new Blake2bHasher(64);
        hasher.Update(input);
        hasher.Finalize(output);
        Assert.Equal("c7018e1b4d61da4728e028232650fd4f6bf96ccf1756e0ab6332933380f4b3bac29ce1fe1d1d47d92d939a0e3733eca6d40f8010f4c4e09ee21a58e09ed4dd64", ToHex(output));
    }

    [Fact]
    public void Blake2b_large_input()
    {
        byte[] input = FromHex("");
        Span<byte> output = stackalloc byte[64];
        var hasher = new Blake2bHasher(64);
        hasher.Update(input);
        hasher.Finalize(output);
        Assert.Equal("0d903d6f1a8d701a7cc54d220bc88c2f254ede16e7cec7fb8f931b5ffd28f3f4b78b145b03ae39c900230cdc6c85684ea1ffd01f1952fc8d4ddf11f911766a23", ToHex(output));
    }

    [Fact]
    public void Blake2b_digest_32_bytes()
    {
        byte[] input = FromHex("4141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141");
        Span<byte> output = stackalloc byte[32];
        var hasher = new Blake2bHasher(32);
        hasher.Update(input);
        hasher.Finalize(output);
        Assert.Equal("5db0e67323e93220e9602568a3c2c43f52dc843e4ea5b1e3deb9d5d80ed9cf2c", ToHex(output));
    }

    [Fact]
    public void Blake2b_digest_20_bytes()
    {
        byte[] input = FromHex("4141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141");
        Span<byte> output = stackalloc byte[20];
        var hasher = new Blake2bHasher(20);
        hasher.Update(input);
        hasher.Finalize(output);
        Assert.Equal("942aa231da91aded491aa5d8d5e3fcbbcf5f58a7", ToHex(output));
    }

    [Fact]
    public void Blake2b_keyed_1_byte()
    {
        byte[] input = FromHex("4141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141");
        Span<byte> output = stackalloc byte[64];
        byte[] key = FromHex("00");
        var hasher = new Blake2bHasher(key, 64);
        hasher.Update(input);
        hasher.Finalize(output);
        Assert.Equal("ea38e60bc4906487dc9ade0f98e68c52140583944ee34cb1bb335163d10e9974c11d98c6798a32af02f41519b0075e1afd1cd792b3698a428a45bf8393315db1", ToHex(output));
    }

    [Fact]
    public void Blake2b_keyed_64_bytes()
    {
        byte[] input = FromHex("4141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141414141");
        Span<byte> output = stackalloc byte[64];
        byte[] key = FromHex("000102030405060708090a0b0c0d0e0f101112131415161718191a1b1c1d1e1f202122232425262728292a2b2c2d2e2f303132333435363738393a3b3c3d3e3f");
        var hasher = new Blake2bHasher(key, 64);
        hasher.Update(input);
        hasher.Finalize(output);
        Assert.Equal("ba7a0ffa13acc8f108e88307bf125495f5a4049869d2c8dd95506830bf7a68c98781027d5e14411c11a7f5dbf9447dbaeeade0774d01bf1e60fa881d6fb1299d", ToHex(output));
    }

}